What was the FIRST DISH you ever learned to cook? Mine was Cantonese steamed ribs!! These little pieces of juicy meat are so versatile not only with barbecue sauce on the grill, but also with different Chinese marinade in the steamer! (think soy sauce, black bean sauce and plum sauce!) ‚Å†
‚Å†
The typical steamed ribs flavor you would get at a dimsum restaurant would be spicy garlic back bean sauce. They release yummy juices while cooking so it usually comes with starchy veggies like taro or pumpkin under them to absorb all that goodness!‚Å†
‚Å†
Ingredients‚Å†
1 Pork ribs strip (buy the cut that is cut across the bones and about 1-inch width)‚Å†
a handful Dried black fungus, soak in water for 30 mins‚Å†
1 large or 2 medium Eddos, peeled and diced '‚Å†
2 tbsp Soy sauce‚Å†
1 tbsp Brown sugar‚Å†
2 tbsp Cornstarch, or sub with arrowroot starch‚Å†

Steam at medium high heat for 15-20mins.
‚Å†
